Bought in 2012 for trip to Scotland; used only twice since; everything truly like-new in function and appearance --
Nikon D-90 digital SLR 12.3 megapixel camera;
Nikkor 18-200mm DX f1:3.5-5.6 VR zoom lens G ED;
Nikkor 10-24mm DX f1:3.5-4.5 zoom G ED lens;
Nikkor 35mm DX f1:1.8 G single-focus lens;
lenses have UV & polarizing filters, plus red #25 filter;
Accessories: Remote Shutter Control; download cord; iPad connection kit; Nikon Quick Charger; two (2) Ni-ion Battery Packs; quick-release tripod attachment; Tamrac Pro-8 black nylon camera bag with compartment separators; SunPak 7500TM Platinum tripod with 3-way panhead w/level; Tamrac black nylon tripod case. 

Package worth $2,500+ at today's prices; price firm and will not separate. Lost interest in photography and don't use it. Would rather have a rifle the money will buy. Will trade for high-end ARs (Daniel Defense, Bravo Company, Spikes Tactical, et al) in like-new condition.

Will meet within 30-45 minutes of Chattanooga for you to verify like-new condition.
